package com.baidu.web.vo.paypal;import com.fasterxml.jackson.annotation.JsonProperty;import lombok.Data;/** * @author xzll * @date 2021/10/8 20:31 * @description */@Datapublic class Frequency {    /**     * 收取或结算订阅费用的时间间隔。enum     * DAY.     每日计费周期     * WEEK.    每周的计费周期     * MONTH.   一个按月计费的周期     * YEAR.    一年一度的账单周期     */    @JsonProperty("interval_unit")    private String intervalUnit;    /**     * 间隔计数     * 参数       最大值     * DAY  	    365     * WEEK	        52     * MONTH	    12     * YEAR     	1     */    @JsonProperty("interval_count")    private Integer intervalCount;}